import React from 'react';

class Contact extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5">
         <h1>Contact</h1>
         <form>
            <input label="Email" placeHolder="Enter your email" />
         </form>
      </div>
    );
  }
}

export { Contact }
